useEffect (() => {
  localStorage.setItem("count", count);
});

componentDidMount(() => {
  count = Number(localStorage.getItem("count"))
});

  return (
    <div>
      <p>You clicked {count} times</p>
      <button onClick={() => setCount(count + props.passValue2)}>
       Increment
